CREATE SCHEMA IF NOT EXISTS chubbiverse;
CREATE TABLE IF NOT EXISTS chubbiverse.frens_traits
(
    contract_address bytea NOT NULL,
    token_id integer NOT NULL,
    accessory text,
    animal text,
    background text,
    body text,
    face text,
    feet text,
    food text,
    head text,
    name text,
    skin text,
    trait_count integer NOT NULL,
    rarity_rank integer NOT NULL,
    CONSTRAINT chubbiverse_frens_traits_pkey PRIMARY KEY (contract_address, token_id)
);

BEGIN;
TRUNCATE TABLE chubbiverse.frens_traits;

COMMIT;

CREATE INDEX IF NOT EXISTS chubbiverse_frens_traits_contract_address_token_id_text_idx ON chubbiverse.frens_traits(contract_address, (token_id::text));
CREATE INDEX IF NOT EXISTS chubbiverse_frens_traits_accessory_idx ON chubbiverse.frens_traits(accessory);
CREATE INDEX IF NOT EXISTS chubbiverse_frens_traits_animal_idx ON chubbiverse.frens_traits(animal);
CREATE INDEX IF NOT EXISTS chubbiverse_frens_traits_background_idx ON chubbiverse.frens_traits(background);
CREATE INDEX IF NOT EXISTS chubbiverse_frens_traits_body_idx ON chubbiverse.frens_traits(body);
CREATE INDEX IF NOT EXISTS chubbiverse_frens_traits_face_idx ON chubbiverse.frens_traits(face);
CREATE INDEX IF NOT EXISTS chubbiverse_frens_traits_feet_idx ON chubbiverse.frens_traits(feet);
CREATE INDEX IF NOT EXISTS chubbiverse_frens_traits_food_idx ON chubbiverse.frens_traits(food);
CREATE INDEX IF NOT EXISTS chubbiverse_frens_traits_head_idx ON chubbiverse.frens_traits(head);
CREATE INDEX IF NOT EXISTS chubbiverse_frens_traits_name_idx ON chubbiverse.frens_traits(name);
CREATE INDEX IF NOT EXISTS chubbiverse_frens_traits_skin_idx ON chubbiverse.frens_traits(skin);
CREATE INDEX IF NOT EXISTS chubbiverse_frens_traits_trait_count_idx ON chubbiverse.frens_traits(trait_count);
CREATE INDEX IF NOT EXISTS chubbiverse_frens_traits_rarity_rank_idx ON chubbiverse.frens_traits(rarity_rank);
